import React from "react"

function DisplayData(props) {

    let categoryList = props.data.availableCategories.map((category) => {
        return (<p key={category.id} onClick={props.clickCategoryCard}>{category.id}</p>)
    })

    let artistList = props.data.featuredArtists.map((artist, index) => {
        return (<p key={artist} onClick={() => props.clickArtist(index)} className={props.data.checkedArtists[index] ? "checked" : null}>{artist}</p>)
    })

    return (
        <div>
            {props.data.currentUser && <p>Hello {props.data.currentUser}!</p>}

            {props.data.selectedCategory
                ? <p>{props.data.selectedCategory} Artists:</p>
                : props.data.categoryList
            }

            {props.data.checkedArtists.length > 0 && <button onClick={props.submitSelectedArtist}>Generate</button>}

            {props.data.featuredArtists
                ? props.data.artistList
                : 'No artists yet'
            }
        </div>
    )
}

export default DisplayData
